import React, { useState } from "react";
import Input from "./inputs/Input";
import Textarea from "./inputs/Textarea";

function ContactForm() {
  const [nume, setNume] = useState("");
  const [email, setEmail] = useState("");
  const [telefon, setTelefon] = useState("");
  const [judet, setJudet] = useState("");
  const [mesaj, setMesaj] = useState("");

  handleSubmit = (e) => {
    e.preventDefault();
    console.log(nume);
  };

  return (
    <div>
      <form>
        <Input
          labelText={"Nume"}
          inputName={"nume"}
          inputType={"text"}
          handleChange={(e) => setNume(e.target.value)}
        />
        <Input labelText={"Email"} inputName={"email"} inputType={"email"} />
        <Input labelText={"Telefon"} inputName={"telefon"} inputType={"text"} />
        <Input labelText={"Judet"} inputName={"judet"} inputType={"text"} />
        <Textarea labelText={"Mesaj"} inputName={"mesaj"} inputType={"text"} />
        <input type="submit" value="Trimite mesajul" />
      </form>
    </div>
  );
}

export default ContactForm;
